sourcesContent:
import {getConnection} from "./../database/database";

const getAlimentos = async (req,res)=>{
    try{
        const connection = await getConnection();
        const result = await connection.query("SELECT * from alimentos");
        console.log(result);
        res.json(result);

    }catch(error){
        res.status(500);
        res.send(error.message)
    }
}

const getAlimento = async (req, res) => {
    try {
        const { id_alimento } = req.params;
        const connection = await getConnection();
        const result = await connection.query("SELECT * FROM alimentos WHERE id_alimento = ?", [id_alimento]);
        res.json(result);
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};

const addAlimentos = async (req, res) => {

    try {
        const {
            codigo, nombre, grupo, energia_kcal, energia_kj, agua_g, proteinas_totales_g, proteinas_vegetales_g,
            proteinas_animal, grasa_total_g, carbohidratos_disponibles_g, fibra_dietaria_g, cenizas_g,
            calcio_mg, fosforo_mg, zinc_mg, hierro_mg, caroteno_equivalentes_totales_ug,
            vitaminaA_equivalentes_totales_ug, tiamina_mg, riboflavina_mg, niacina_mg, vitaminaC_mg,
            acido_folico_ug, sodio_mg, potasio_mg
        } = req.body;
        if (codigo === undefined || nombre === undefined || grupo === undefined || 
            energia_kcal === undefined || energia_kj === undefined || agua_g === undefined || 
            proteinas_totales_g === undefined || proteinas_vegetales_g === undefined || 
            proteinas_animal === undefined || grasa_total_g === undefined || 
            carbohidratos_disponibles_g === undefined || fibra_dietaria_g === undefined || 
            cenizas_g === undefined || calcio_mg === undefined || fosforo_mg === undefined || 
            zinc_mg === undefined || hierro_mg === undefined || caroteno_equivalentes_totales_ug === undefined || 
            vitaminaA_equivalentes_totales_ug === undefined || tiamina_mg === undefined || 
            riboflavina_mg === undefined || niacina_mg === undefined || vitaminaC_mg === undefined || 
            acido_folico_ug === undefined || sodio_mg === undefined || potasio_mg === undefined) {
            
            res.status(400).json({ message: "Bad Request: fill all fields." });
        }
    
        const alimentos = {
            codigo, nombre, grupo, energia_kcal, energia_kj, agua_g, proteinas_totales_g, proteinas_vegetales_g,
            proteinas_animal, grasa_total_g, carbohidratos_disponibles_g, fibra_dietaria_g, cenizas_g,
            calcio_mg, fosforo_mg, zinc_mg, hierro_mg, caroteno_equivalentes_totales_ug,
            vitaminaA_equivalentes_totales_ug, tiamina_mg, riboflavina_mg, niacina_mg, vitaminaC_mg,
            acido_folico_ug, sodio_mg, potasio_mg
        };
        const connection = await getConnection();
        await connection.query("INSERT INTO alimentos SET ?", alimentos);
        res.json({message: "Nuevo Alimento aadido "});
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};


const updateAlimento = async (req, res) => {
    try {
        const { id_alimento } = req.params;
        const {
            codigo, nombre, grupo, energia_kcal, energia_kj, agua_g, proteinas_totales_g, proteinas_vegetales_g,
            proteinas_animal, grasa_total_g, carbohidratos_disponibles_g, fibra_dietaria_g, cenizas_g,
            calcio_mg, fosforo_mg, zinc_mg, hierro_mg, caroteno_equivalentes_totales_ug,
            vitaminaA_equivalentes_totales_ug, tiamina_mg, riboflavina_mg, niacina_mg, vitaminaC_mg,
            acido_folico_ug, sodio_mg, potasio_mg
        } = req.body;
        if (id_alimento === undefined || codigo === undefined || nombre === undefined || grupo === undefined || 
            energia_kcal === undefined || energia_kj === undefined || agua_g === undefined || 
            proteinas_totales_g === undefined || proteinas_vegetales_g === undefined || 
            proteinas_animal === undefined || grasa_total_g === undefined || 
            carbohidratos_disponibles_g === undefined || fibra_dietaria_g === undefined || 
            cenizas_g === undefined || calcio_mg === undefined || fosforo_mg === undefined || 
            zinc_mg === undefined || hierro_mg === undefined || caroteno_equivalentes_totales_ug === undefined || 
            vitaminaA_equivalentes_totales_ug === undefined || tiamina_mg === undefined || 
            riboflavina_mg === undefined || niacina_mg === undefined || vitaminaC_mg === undefined || 
            acido_folico_ug === undefined || sodio_mg === undefined || potasio_mg === undefined) {
            return res.status(400).json({ message: "Bad Request: fill all fields." });
        }
        const alimentos = {
            codigo, nombre, grupo, energia_kcal, energia_kj, agua_g, proteinas_totales_g, proteinas_vegetales_g,
            proteinas_animal, grasa_total_g, carbohidratos_disponibles_g, fibra_dietaria_g, cenizas_g,
            calcio_mg, fosforo_mg, zinc_mg, hierro_mg, caroteno_equivalentes_totales_ug,
            vitaminaA_equivalentes_totales_ug, tiamina_mg, riboflavina_mg, niacina_mg, vitaminaC_mg,
            acido_folico_ug, sodio_mg, potasio_mg
        };
        const connection = await getConnection();
        const result = await connection.query(
            "UPDATE alimentos SET ? WHERE id_alimento = ?",
            [alimentos, id_alimento]
        );
        res.json(result);
    } catch (error) {
        res.status(500).send(error.message);
    }
};

const deleteAlimento = async (req, res) => {
    try {

        const { id_alimento } = req.params;
        const connection = await getConnection();
        const result = await connection.query("DELETE FROM alimentos WHERE id_alimento = ?", [id_alimento]);
        res.json(result);
    } catch (error) {
        res.status(500);
        res.send(error.message);
    }
};



export const methods ={
    getAlimentos,
    addAlimentos,
    updateAlimento,
    getAlimento,
    deleteAlimento
}

